import React from 'react'
import axios from "axios";
import './image_upload.css'

const Image_upload = () => {
  
  // flask intergration starts
  const [image, setImage] = useState('')

  const insertImage = () =>{
    APIService.InsertImage({image})
    .then((response) => insertImage(response))
    .catch(error => console.log('error',error))
  }

  const handleSubmit=(event)=>{ 
    event.preventDefault()
    insertImage()
    setImage('')
  }
    // flask intergration ends

  return (
    <div className='image_upload'>
      <div className='circlier_number'>2</div>
      <form onSubmit = {handleSubmit}>
      <input 
          type="text"
          className="form-control" 
          placeholder ="Enter title"
          value={image}
          onChange={(e)=>setImage(e.target.value)}
          required
          />
      </form>
      
      {/* new line start}
      <br></br>
      <button onClick={getData}>See info</button>
        {profileData && <div>
              <p>Profile name: {profileData.profile_name}</p>
              <p>About me: {profileData.about_me}</p>
            </div>
        }
         { end of new line */}
    </div>
  )
}

export default Image_upload
